def validPalindrome(s):
    str=''
    if(s==s[::-1]):
        return(True)
    else:
        for i in range(0,len(s)):
            if(i==0):
                str=s[1:len(s)]
                #print(i,str)
                if(str==str[::-1]):
                    return True
            elif(i<len(s)):
                str=s[0:i]+s[i+1:len(s)]
                #print(i,str)
                if(str==str[::-1]):
                    return True
            else:
                str=s[0:len(s)-1]
                #print(i,str)
                if(str==str[::-1]):
                    return True
        return False
    #print(s[::-1])
s="abcad"
#s=""
print(validPalindrome(s))
print(s[1:3])
